import React from 'react';
import { PageContainer, PageTitleOne, PageTitleTwo, PageText, PageAnchorTag } from '../global-page-styles/global-page-styles';
import { CustomButton } from '../../components/custom-button/custom-button.component';


const AboutPage = (props) =>{

  return (
    <PageContainer>
    <PageTitleOne className='date'>About</PageTitleOne>
    <PageTitleTwo>Description and Mission Statement:</PageTitleTwo>
    <PageText>Dale Street is a Mixing, Mastering, & Production studio. As a former DJ and long time musician, Marcus Dale Norwood started Dale Street Studio to represent his expanding studio, growing sound and 20+ years of experience in audio. As well as a former education from Ball State University with a focus on audio production and sound design. I'm now offering production, mixing & mastering services. This site is dedicated to the audio side of Dale Street and helping artists succeed in their sound.
    </PageText>
    <PageTitleTwo>Booking:</PageTitleTwo>
    <PageText style={{marginBottom: '45px'}}>Let me know how you'd like me to help on your next roject. Contact me today to get rates and book my services. Whether you're finalizing a track to playback on different streaming sources, needing a fresh master through some high quality hybrid digital and analog gear, need a new set of ears to mix on your home recorded project, or are working on a new production that you'd like to work with me on. I'd love to see how I can help. Check out my services here on the site, some of my past & recent work, then drop some info in the contact form. I'll get back to talk shop and get you on the schedule! 
    </PageText>
    <center><CustomButton style={{textAlign: 'center'}} onClick={() => props.history.push('/')}>Home</CustomButton> </center>
    </PageContainer>
  )
};




export default React.memo(AboutPage);
